import HeadNav from "../Common/HeadNav";




function ProfilePage() {
    return<>

    <HeadNav></HeadNav>






    <div className="col-lg-5 sidenav">
                    <div>


                        {
                            AllProblems.map((problem) => {

                                return <ProblemCard key={problem.CandidateName}
                                    problem={problem}
                                />
                            }
                            )
                        }
                    </div>
                </div>

    </>
}

export default ProfilePage;
